import React from "react";

function Titulo() {
  return <h1>Titulo</h1>;
}

function Subtitulo() {
  return <h2> Subtitulo </h2>;
}

function Descripcion() {
  return <p>Mi nombre es, {props.name}.</p>;
}

// function Titulo(props) {
